import React from 'react';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Pager from '../Components/pager';

class jobList extends React.Component{

    constructor(){
        super(props);
        this.state = {show : false};
    }

    render(){
        return(
            <div>
                <section id="featured-services" className="featured-services">
                    <div className="container">
                        <div className="row justify-content-md-center">
                            <div className="col-lg-4 col-md-6">
                                <div className="icon-box">
                                    <div className="icon"><i className="bi bi-laptop"></i></div>
                                    <h4 className="title"><a href="">Get More Visibility</a></h4>
                                    <p className="description">Voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident</p>
                                    <div><Button>Show Applicants</Button></div>
                                </div>
                            </div>
                            <div className="col-lg-4 col-md-6 mt-4 mt-md-0">
                                <div className="icon-box">
                                    <div className="icon"><i className="bi bi-card-checklist"></i></div>
                                    <h4 className="title"><a href="">Organize Your Candidate</a></h4>
                                    <p className="description">Minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat tarad limino ata</p>
                                    <div><Button>Show Applicants</Button></div>
                                </div>
                            </div>
                            <div className="col-lg-4 col-md-6 mt-4 mt-lg-0">
                                <div className="icon-box">
                                    <div className="icon"><i className="bi bi-clipboard-data"></i></div>
                                    <h4 className="title"><a href="">Verify Their Abilities</a></h4>
                                    <p className="description">Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur</p>
                                    <div><Button>Show Applicants</Button></div>
                                </div>
                            </div>
                        </div>
                        <div className="row justify-content-md-center mb-3">
                            <div className="col-lg-6 col-md-6 mb-3">
                                <Pager first={1} />
                            </div>
                        </div>
                    </div>
                </section>

            </div>
        )
    }
}

export default jobList;
